column8:
玄関・階段・子供部屋などのちょっとした夜間照明に！防雨型なので屋外でも使用可能。<br>人が近づけばパッと点灯します。<br>置型使用ではどこでもちょこんとOK!壁面への取りつけも可能（付属の取り付け具使用）！くるっくるっくるっと向きが変えられます。
<HTML>
<HEAD>



<TITLE></TITLE>
</HEAD>
<BODY>
<TABLE border="1">
  <TBODY>
    <TR>
      <TD>電源</TD>
      <TD>単2形乾電池4本（別売り）</TD>
    </TR>
    <TR>
      <TD>消費電力</TD>
      <TD>アルカリ乾電池を使用し1日の点灯<BR>
      回数を30回とした場合：約1年</TD>
    </TR>
    <TR>
      <TD>センサー探知範囲</TD>
      <TD>距離：前方約6m　<BR>
      角度：水平100度・上下角60度</TD>
    </TR>
    <TR>
      <TD>点灯開始照度</TD>
      <TD>約２０ルクス以下</TD>
    </TR>
    <TR>
      <TD>サイズ・質量</TD>
      <TD>１２０×９５×１４５mm　２６６g</TD>
    </TR>
    <TR>
      <TD>点灯時間</TD>
      <TD>約１０～１２秒（初回のみ約４０秒）</TD>
    </TR>
    <TR>
      <TD>防水機能</TD>
      <TD>IP44</TD>
    </TR>
  </TBODY>
</TABLE>
</BODY>
